import { useSelector } from "react-redux";


function Letters() {
    const incorrectLetters = useSelector(storeState => storeState.incorrectLetters);
  return (
    <div className="App">
      <p>entered: {incorrectLetters}</p>
    </div>
  );
}

export default Letters;
